export default {
  methods: {
    logout: function logout(label) {
      this.$store.dispatch('logout');
      FB.logout();
      this.$ga.event({
        eventCategory: 'Header',
        eventAction: 'Header_Link_Click',
        eventLabel: label
      });
      location.reload();
    },
    tryToggle: function tryToggle() {
      if (window.innerWidth < 993) {
        this.$refs.navCollapse.toggle();
      }
    },
    // Analytics
    gaEvent: function gaEvent(label) {
      this.$ga.event({
        eventCategory: 'Header',
        eventAction: 'Header_Link_Click',
        eventLabel: label
      });
    }
  },
  computed: {
    isAuthorized: function isAuthorized() {
      return this.$store.state.isAuthorized;
    }
  }
};
